 drops get to 35%)  https:\/\/www.amazon.com\/gp\/product\/B07BZL244S\/ref=as_li_tl?ie=UTF8\\u0026camp=1789\\u0026creative=9325\\u0026creativeASIN=B07BZL244S\\u0026linkCode=as2\\u0026tag=b2t-20\\u0026linkId=8d0d7b805dc01f301f0829f12ecb5032\\n   Non-Amazon Source: https:\/\/www.purehealthdiscounts.com\/\\n \\nGet Humidifiers here:\\n   Price for humidifier with 2-liter tank https:\/\/www.amazon.com\/gp\/product\/B07RZSBSHJ\/ref=as_li_tl?ie=UTF8\\u0026camp=1789\\u0026creative=9325\\u0026creativeASIN=B07RZSBSHJ\\u0026linkCode=as2\\u0026tag=b2t-20\\u0026linkId=65bba458cfb34bfc86515054ecefb500\\n\\nThe MMS KV Lab is not too clear on what you need to get. \\nSo you need part A https:\/\/kvlab.com\/sodium-chlorite-cd-kit-part-a.html and part B https:\/\/kvlab.com\/hydrochloric-acid-4-percent.html\\n\\nGene’s comment from backstage: These 2 together are mixed 1 drop to 1 drop.  For a dose (only used if you are sick or have a disease, otherwise not necessary).  A dose for an adult of 180 pounds is 3 drops for something like a common cold.  If very sick, then 5 or 6 drops.  For those weighing less do the percentage.  Also for animals do the percentage.  For example if a dog weighed 30 pounds and it was just regular sick like Rick's rocky is now then he would just give Rocky 1 or 2 drops.  The drops are given even 1.5 hours if just normal sick.  If violent illness, then up the drops and frequency.  Use the protocols in the book (Jim Humble: The Master Mineral Solution of the Third Millennium: link backstage for PDF)For me when I got botulism poisoning my wife gave me 5 drop doses every 5 minutes to keep me alive, in between CPR to keep me alive.  After 5 hours I was able to breath on my own and my heart worked without her help and so I took over doing the drops for another 8 hours.  After that I was done and back to normal health.  \\n\\nFor more information on the uses of MMS and chlorine dioxide solution (CDS) see the Genesis II Church Forum at: http:\/\/g2cforum.org\/\\n\\nGene recommends Shungite for protection of EMF which may magnify the virus.\\n\\nRick purchased several of these:\\n\\nPrice for Heka Naturals Polished Shungite Pyramid 3 Inches, Contains Fullerenes for EMF Protection https:\/\/www.amazon.com\/gp\/product\/B01NC0ZVB9\/ref=as_li_tl?ie=UTF8\\u0026camp=1789\\u0026creative=9325\\u0026creativeASIN=B01NC0ZVB9\\u0026linkCode=as2\\u0026tag=b2t-20\\u0026linkId=9526d0ade32dd22cc309115e223bd09a\\n\\nPrice for Karelian Heritage Regular Shungite Pyramid Set for EMF Protection, 4 Pieces https:\/\/amzn.to\/32CJEn0\\n\\nThese are sold out everywhere.  Sawdust face masks do not work for small viruses.  You need M95.  The only one in stock on 2-28 I could find on Amazon ships in 4-6 weeks:\\n\\nPrice for Disposable N95 Face Mask (7 count)\\n(when ordered on 2\/29 Arrives: March 20 - April 10) https:\/\/www.amazon.com\/gp\/product\/B07NRYY42H\/ref=as_li_tl?ie=UTF8\\u0026camp=1789\\u0026creative=9325\\u0026creativeASIN=B07NRYY42H\\u0026linkCode=as2\\u0026tag=b2t-20\\u0026linkId=977ebc1bb8bdc7238058da3982c4cf11\\n\\nThe only thing I could find faster is my sponsor which may be overkill since it includes a suit, eye where and globes (besides the mask):  Ultimate Safe Suit  (Blessed10 to save 10%) http:\/\/www.ultimatesafetysuit.com\/\\n\\nB2T Sponsor My Patriot Supply shipping is backed up, but are encouraging to order now for first come first serve:   http:\/\/preparewithrick.com and  http:\/\/waterwithrick.com\\n\\nYou can get things quicker here:\\n Price for 30 Day Augason Farms QSS Certified https:\/\/www.amazon.com\/gp\/product\/B00IW1NQDC\/ref=as_li_tl?ie=UTF8\\u0026camp=1789\\u0026creative=9325\\u0026creativeASIN=B00IW1NQDC\\u0026linkCode=as2\\u0026tag=b2t-20\\u0026linkId=5ad41972723413b40732ecec9623ee23\\n\\n#TheGreatAwakening\\n#DeepState\\n#QanonLatest\"},\"lengthSeconds\":\"0\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UC3yCYDoc70dMMQGKL364wHQ\",\"ownerGplusProfileUrl\":\"https:\/\/plus.google.com\/107846411546
